  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  National Wildlife Refuge outlines Refuge accomplishments during the 1991 calendar
  year. The report begins by giving a brief introduction to the Refuge, as well as
  the climatic conditions and land acquisition program during the year. Planning details
  compliance with environmental mandates and research and investigations. Administration
  is discussed; topics include personnel, funding, safety, and technical assistance.
  Habitat management is discussed; topics include wetlands, croplands, grasslands,
  grazing, haying, pest control, and WPA easement monitoring. Wildlife- including
  wildlife diversity, endangered and threatened species, waterfowl, marsh and water
  birds, shorebirds, raptors, other migratory birds, game mammals, other resident
  wildlife, fisheries resources, wildlife propagation and stocking, animal control,
  marking and banding, and disease prevention and control- is also covered. The public
  uses section discusses information and interpretation, hunting, fishing, trapping,
  off-road vehicling, and enforcement. The equipment and facilities section discusses
  equipment utilization and replacement, communications systems, and computer systems.
  Cooperative programs, Refuge brochures, and photographs are attached.\",\n\t\"owner_org\":
